import './AboutMe.css';

function AboutMe() {
  return (
            <div>
                <p>
                    Come view my projects!
                </p>
                <h3>Run Buddy</h3>
                <a href="https://github.com/edpris10/run-buddy.git" target="blank">    
                    
                    <img src="./assets/images/Run-Buddy.png" alt="" /> <br />
                </a>  
            </div>    
  );
}

export default AboutMe;
